<!DOCTYPE html>
<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
        <title>稀饭 - 远程设置平台</title>
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="viewport" content="width=device-width, initial-scale=1, user-scalable=no, minimal-ui">
	<meta http-equiv="Access-Control-Allow-Origin" content="*">
    </head>
<style>
body {
    text-align: center;
    height: 85%;
    margin: 0 8% 0 8%;
}

.btn {
    font-family: inherit;
    outline-style: none;
    box-shadow: none;
    border-color: transparent;
    color: #FFFFFF;
    display: inline-block;
    border-radius: 4px;
    border: none;
    text-align: center;
    font-size: 18px;
	font-weight: bold;
    padding: 10px;
    width: 200px;
    transition: all 0.18s ease;
    cursor: pointer;
    margin: 5px;
}

.btn-orange {
    box-shadow: 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: rgba(224, 157, 0, 0.75);
}

.btn-orange:active {
    box-shadow: inset 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: rgba(224, 157, 0, 1);
}

.btn-blue {
    box-shadow: 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: #64479b;
}

.btn-blue:active {
    box-shadow: inset 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: #462c78;
}

.btn-default {
    box-shadow: 0 0 0;
    background-color: rgba(211, 211, 211, 0.55);
    color: gray;
}

.btn-default:active {
    box-shadow: inset 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: rgba(211, 211, 211, 1);
}

.btn-green {
    box-shadow: 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: #11c668;
}

.btn-green:active {
    box-shadow: inset 2px 2px 2px rgba(2, 2, 2, 0.22);
    background-color: #0c8646;
}

table a:link {
    color: #666;
    font-weight: bold;
    text-decoration: none;
}

table a:visited {
    color: #999999;
    font-weight: bold;
    text-decoration: none;
}

table a:active, table a:hover {
    color: #bd5a35;
    text-decoration: underline;
}

table {
    margin: 0px;
    color: #fff;
	font: Microsoft YaHei;
    font-size: 18px;
    width: 100%;
    border: #ccc 0px solid;
    -webkit-border-radius: 3px;
    border-radius: 3px;
    -webkit-box-shadow: 0 1px 2px #d1d1d1;
    box-shadow: 0 0px 0px #d1d1d1;
}

table th {
    padding: 21px 25px 22px 25px;
    border-top: 0px solid #fafafa;
    border-bottom: 0px solid #e0e0e0;
    background: #7359a5;
    opacity: 1;
    background: -moz-linear-gradient(top, #ededed, #ebebeb);
}

table th {
    text-shadow: 0px 0px 0px #fff;
    text-align: left;
    padding-left: 20px;
}

table tr:first-child th:first-child {
    -webkit-border-top-left-radius: 3px;
    border-top-left-radius: 8px;
}

table tr:first-child th:last-child {
    -webkit-border-top-right-radius: 3px;
    border-top-right-radius: 8px;
}

table tr {
    text-align: center;
    padding-left: 20px;
}

table td:first-child {
    text-align: left;
    padding-left: 20px;
    border-left: 0;
    border-bottom: 0;
}

table td {
    color: gray;
    text-overflow: ellipsis;
    overflow: hidden;
    white-space: nowrap;
    padding: 12px;
    background: #fafafa;
    background: -webkit-gradient(linear, left top, left bottom, from(#fbfbfb), to(#fafafa));
}

table td input, table td select {
    font-family: inherit;
    padding: 9px;
    border: 0;
	width: 90%;
}

table tr[data-enabled="true"] > td {
    color: darkslategray;
    background: #41d186;
	opacity: 1;
}

table tr[data-enabled="true"] > td input, table tr[data-enabled="true"] > td select {
    background: #fffffff2;
	border-radius: 5px;
}

table tr[data-enabled="false"] > td {
    background: rgb(0 0 0 / 0.06);
}

table tr[data-enabled="false"] > td input, table tr[data-enabled="false"] > td select {
    background: rgb(0 0 0 / 0.11);
	border-radius: 5px;
}

table tr:last-child td {
    border-bottom: 0;
}

table tr:last-child td:first-child {
    border-bottom-left-radius: 8px;
}

table tr:last-child td:last-child {
    -webkit-border-bottom-right-radius: 3px;
    border-bottom-right-radius: 8px;
}

table tbody tr, table tbody tr td, table tbody tr td input, table tbody tr td select {

    transition: background-color 0.5s, color 0.5s, transform 0.5s, opacity 0.5s ease;
}

#settings-table {
    height: 75%;
    text-align: center;
    margin-bottom: 2%;
}

h1 {
    display: inline-flex;
}

h1 span {
bottom: 10px;
    margin-bottom: auto;
    margin-top: auto;
    margin-left: 0px;
    margin-right: 20px;
    font-size: 18px;
}

h1 .aam-icon {
    width: 40px;
    height: 40px;
    content: url(/img/icon128.png);
}

h1 .red-icon {
    z-index: -1;
    content: url('/img/icon128.png');
    opacity: .2;
    position: absolute;
    width: 100%;
    height: 48px;
}

.input-popup-overlay {
    display: none;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: rgba(128, 128, 128, 0.43);
    opacity: 0;
    transition: opacity 0.5s ease;
}

.input-popup {
    display: inline-block;
    position: absolute;
    top: 25%;
    left: 25%;
    width: 50%;
    height: 50%;
    background-color: rgba(255, 255, 255, 0.6);
    box-shadow: rgba(86, 86, 86, 0.5) 3px 3px 10px 5px;
}

.input-popup h1 {
    text-align: left;
    display: inline-block;
    width: calc(100% - 40px);
    margin: 10px;
    padding: 10px;
    background-color: whitesmoke;
}

.input-popup span {
    display: inline-block;
    float: left;
}

.input-popup input {
    padding: 4px;
    float: right;
    width: 70%;
    line-height: 1;
}

.input-popup textarea {
    white-space: pre;
    height: calc(100% - 140px);
    width: calc(100% - 40px);
    max-height: calc(100% - 140px);
    max-width: calc(100% - 40px);
    padding: 10px;
    background-color: whitesmoke;
}

table tr td:nth-child(1) {
    width: 300px;
}

table tr td:nth-child(3) {
    width: 100px;
}

table tr td:nth-child(4) {
    width: 100px;
}

table tr td:nth-child(5) {
    width: 68px;
}

button.delete {
    background: #ff3939;
    color: #ffffff;
    border: none;
    border-radius: 10px;
    height: 34px;
    width: 50px;
    font-size: 17px;
}

table tr th:nth-child(1) {
    width: 27%;
}

table tr th:nth-child(2) {
    width: 46.3%;
}

table tr th:nth-child(3) {
    width: 9.6%;
}

input {
    outline: none;
}

#email {
	background-color: rgba(211, 211, 211, 0.55);
	color: #000;
	border: 0px solid #000000;
	width: 169px;
	height: 34px;
	outline: none;
	font-weight: 700;
	border-radius: 4px;
	margin-right: 40px;
	position: relative;
	top: 0px;
	left: 0px;
	padding-left: 10px;
	margin-top: 0px;
	margin-bottom: 0px;
	font-size: 16px;
}

#password {
	background-color: rgba(211, 211, 211, 0.55);
	color: #000;
	border: 0px solid #000000;
	width: 169px;
	height: 34px;
	outline: none;
	font-weight: 700;
	border-radius: 4px;
	margin-right: 40px;
	position: relative;
	top: 0px;
	left: 0px;
	padding-left: 10px;
	margin-top: 0px;
	margin-bottom: 0px;
	font-size: 16px;
}

.Info {
	visibility: hidden;
	max-width: 260px;
	max-height: 76px;
	background-color: #1f1f1ff2;
	color: #fff;
	text-align: center;
	line-height: 38px;
	border-radius: 6px;
	padding: 8px 0;
	position: absolute;
	z-index: 1;
	top: 40%;
	left: 8%;
	right: 0;
	margin: auto;
	font-size: 24px;
}

.show {
	visibility: visible;
	-webkit-animation: fadeIn 1s;
	animation: fadeIn 0.4s;
}

@-webkit-keyframes fadeIn {
	from {opacity: 0;} 
	to {opacity: 1;}
}
  
@keyframes fadeIn {
	from {opacity: 0;}
	to {opacity:1 ;}
}
</style>
